    <header>
      <div className="logo">Wemerson Queiroz</div>
      <button
        onClick={handleClick}
        className="nav-toggle"
        aria-label="toggle navigation">
        <span className="hamburger"></span>
      </button>
      <Nav />
    </header>
  )
}
